import React from 'react';
import {Link} from 'react-router-dom' 

import Auth from '../utils/auth'

const Authentication = props => (
	props.token
	? <div onClick={ () => Auth.logout() }>Logout</div>
	: <Link to='/'>Login</Link>
);

export default Authentication
